import React from "react";

const HomePage = () => {
  return (
    <div className="relative h-screen bg-cover bg-center" style={{ backgroundImage: "url('https://source.unsplash.com/featured/?technology')" }}>
      {/* Overlay */}
      <div className="absolute inset-0 bg-black bg-opacity-50"></div>

      {/* Content */}
      <div className="relative z-10 flex flex-col items-center justify-center h-full text-center text-white">
        <h1 className="text-4xl md:text-6xl font-bold animate-fade-in-down">
          Welcome to My Portfolio
        </h1>
        <p className="mt-4 text-lg md:text-2xl animate-fade-in-up">
          Showcasing my journey in tech and innovation.
        </p>
        <button className="mt-6 px-6 py-3 bg-blue-500 hover:bg-blue-600 rounded-md text-lg font-semibold animate-bounce">
          Explore Now
        </button>
      </div>

      {/* Animation Styles */}
      <style jsx>{`
        @keyframes fade-in-down {
          from {
            opacity: 0;
            transform: translateY(-20px);
          }
          to {
            opacity: 1;
            transform: translateY(0);
          }
        }
        @keyframes fade-in-up {
          from {
            opacity: 0;
            transform: translateY(20px);
          }
          to {
            opacity: 1;
            transform: translateY(0);
          }
        }
        .animate-fade-in-down {
          animation: fade-in-down 1s ease-out;
        }
        .animate-fade-in-up {
          animation: fade-in-up 1s ease-out;
        }
      `}</style>
    </div>
  );
};

export default HomePage;
